import React, { Component } from 'react'

export default class Footer extends Component {
    render() {
        return (
            <div class="footer-container">
                <button class="footer-button">Yearly Lesson Plan</button>
                <button class="footer-button">View Semester Reports</button>
                <button class="footer-button">Guest Speakers</button>
                <button class="footer-button">Explore Other Tutors</button>                
            </div>
        )
    }
}
